import React from "react";

function Header() {
    return (
        <div className="header">
            <div className="headerList">
                <div className="headerListItem">
                    <FontAwesomeIcon icon="fa-solid fa-bed" />
                </div>
            </div>
        </div>
    );
}

export default Header;
